Getting started

Add comments to your API source code, See Declarative Comments Format

Download swag by using:
$ go get -u github.com/swaggo/swag/cmd/swag


Run the swag in project root folder which contains main.go file, The swag will parse your comments and generate required files(docs folder and docs/doc.go).$ swag init



